import React from 'react'
import AboutMeCard from './aboutMeCard'
import HobbiesCard from './hobbiesCard'

export default function aboutMeContainer() {
    const classes = {
        margin: '2%'
    }
    return (
        <div style={classes}>
            <AboutMeCard />
            <HobbiesCard />

        </div>
    )
}
